etter for everyone.'=>'Colectarea datelor de utilizare ne permite să îți personalizăm experiența de inițializare a magazinului, să îți oferim conținut mai relevant și să ajutăm la îmbunătățirea WooCommerce pentru toți utilizatorii.','Please <a href="%1$s">Install the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions. Alternatively, you can <a href="%2$s">download</a> and install it manually.'=>'<a href="%1$s">Instalează Manager de actualizări WooCommerce.com</a> ca să primești în continuare actualizări și suport îmbunătățit, sunt incluse în abonamentele WooCommerce.com. Ca alternativă, poți să <a href="%2$s">descarci</a> extensia și să o instalezi manual.','Please <a href="%1$s">activate the WooCommerce.com Update Manager</a> to continue receiving the updates and streamlined support included in your WooCommerce.com subscriptions.'=>'<a href="%1$s">Activează Manager de actualizări WooCommerce.com</a> ca să primești în continuare actualizări și suport îmbunătățit, sunt incluse în abonamentele WooCommerce.com.',' Activate WooCommerce.com Update Manager to update.'=>' Activează Manager de actualizări WooCommerce.com pentru a actualiza.',' <a href="%1$s">Install WooCommerce.com Update Manager</a> to update.'=>' <a href="%1$s">Instalează Manager de actualizări WooCommerce.com</a> pentru a actualiza.','block keywordrich-text'=>'text îmbogățit','block keywordtextarea'=>'zonă text','block descriptionA text-area field for use in the product editor.'=>'Un câmp pentru zona cu text de folosit în editorul de produse.','block titleProduct textarea block'=>'Bloc zonă text pentru produs','block keywordsubsection'=>'subsecțiune','block descriptionThe product subsection description.'=>'Descrierea subsecțiunii pentru produs.','block titleProduct subsection description'=>'Descriere subsecțiune produs','Invalid %s provided.'=>'Ai furnizat un %s care nu este valid.','Internal server error'=>'E