i.','Unsupported argument type provided as value.'=>'Ai furnizat un tip de argument neacceptat ca valoare.','Invalid password. Generate a new one from %s.'=>'Parola nu este validă. Generează una nouă din %s.','Connection password:'=>'Parolă pentru conexiune:','If you don\'t have an application password (not your account password), generate a password from %s'=>'Dacă nu ai o parolă pentru aplicație (nu este identică cu parola contului), generează o parolă din %s','Your store is already connected.'=>'Magazinul tău este deja conectat.','Are you sure you want to disconnect your store from WooCommerce.com?'=>'Sigur vrei să-ți deconectezi magazinul de la WooCommerce.com?','Your store is not connected to WooCommerce.com. Run `wp wc com connect` command.'=>'Magazinul tău nu este conectat la WooCommerce.com. Rulează comanda „wp wc com connect”.','Customers can still save the file to their device, but by default file will be opened instead of being downloaded (does not work with redirects).'=>'Clienții pot să salveze în continuare fișierul pe dispozitivul lor, dar, în mod implicit, fișierul va fi deschis în loc să fie descărcat (nu funcționează cu redirecționări).','Open downloadable files in the browser, instead of saving them to the device.'=>'Deschide fișierele descărcabile în navigator, în loc să le salvezi pe dispozitiv.','Open in browser'=>'Deschide în navigator','Summarize this product in 1-2 short sentences. We’ll show it at the top of the page.'=>'Descrie acest produs în una sau două propoziții scurte. Descrierea va fi afișată în partea de sus a paginii.','Describe this product. What makes it unique? What are its most important features?'=>'Descrie acest produs. Ce îl face unic? Care sunt cele mai importante calități ale sale?','Product types define available product details and attributes, such as downloadable files and variations. They’re also used for analytics and inventory management.'=>'Tipurile de produse definesc detaliile și atributele produselor disponibile, cum ar fi fișierele descărcabile și variațiile. Ele sunt folosite și pentru analize și gestionarea stocurilor.','<b>Variable –</b> a product with variations, each of which may have a different SKU, price, stock option, etc. For example, a t-shirt available in different colors and/or sizes.'=>'<b>Variabil -</b> un produs cu mai multe variații, fiecare variație poate să aibă un alt SKU, un alt preț, o altă opțiune în stoc etc. De exemplu, un tricou este disponibil în mai multe culori și/sau mărimi.','<b>External or Affiliate –</b> one that you list and describe on your website but is sold elsewhere.'=>'<b>Extern sau preluat -</b> un produs pe care îl arăți și îl descrii pe site-ul tău dar care este vândut și de alții.','<b>Grouped –</b> a collection of related products that can be purchased individually and only consist of simple products. For example, a set of six drinking glasses.'=>'<b>Grupate -</b> o colecție de produse similare care pot fi cumpărate și individual, fiind compusă din produse simple. De exemplu, un set de șase pahare.','<b>Simple –</b> covers the vast majority of any products you may sell. Simple products are shipped and have no options. For example, a book.'=>'<b>Simplu -</b> acoperă marea majoritate a produselor pe care le poți vinde. Produsele simple sunt livrate ca atare și nu au opțiuni. De exemplu, o carte.','Sofia District'=>'Districtul Sofia','block descriptionDisplay products from your store in a grid layout.'=>'Afișează produsele din magazin într-un aranjament grilă.','block titleAll Products'=>'Toate produsele','block descriptionDisplay a grid of products from your selected categories.'=>'Afișează o grilă de produse din categoriile selectate.','block titleProducts by Category'=>'Produse după categorii','block descriptionShow all product categories as a list or dropdown.'=>'Arată toate categoriile de produse ca o listă sau o listă derulantă.','block titleProduct Categories List'=>'Listă categorii de produse','block descriptionDisp