ierea scurtă a produsului în format HTML.','ID of the parent product, if applicable.'=>'ID-ul produsului părinte, dacă este aplicabil.','&quot;%s&quot; is not available for purchase.'=>'„%s” nu este disponibil pentru cumpărare.','The "%1$s" coupon has been removed from your cart: %2$s'=>'Cuponul „%1$s” a fost înlăturat din coșul tău: %2$s','"%s" has already been applied and cannot be used in conjunction with other coupons.'=>'„%s” a fost deja aplicat și nu poate fi folosit împreună cu alte cupoane.','Coupon code "%s" has already been applied.'=>'Codul de cupon „%s” a fost deja aplicat.','"%s" is an invalid coupon code.'=>'„%s” este un cod de cupon invalid.','Cart item is invalid.'=>'Produsul din coș este invalid.','Invalid coupons were removed from the cart: "%s"'=>'Au fost înlăturate din coș cupoanele invalide: „%s”','Cannot create order from empty cart.'=>'Nu pot să creez o comandă cu un coș gol.','The chosen rate ID for the package.'=>'ID-ul tarifului ales pentru pachet.','Limit result set to reviews from specific product IDs.'=>'Limitează setul de rezultate la recenzii pentru anumite ID-uri produs.','Limit result set to reviews from specific category IDs.'=>'Limitează setul de rezultate la recenzii pentru anumite ID-uri de categorie.','Method not implemented'=>'Metoda nu a fost implementată','New quantity of the item in the cart.'=>'Cantitate nouă pentru elementul din coș.','Unique identifier (key) for the cart item to update.'=>'Identificator unic (cheie) pentru produsul din coș de actualizat.','The %s payment gateway is not available.'=>'Gateway-ul de plată %s nu este disponibil.','No payment method provided.'=>'Nu a fost furnizată nicio metodă de plată.','Invalid payment result received from payment method.'=>'A fost primit rezultatul plată invalidă de la metoda de plată.','Data to pass through to the payment method when processing payment.'=>'Date care să fie trecute pentru metoda de plată la procesarea plății.','Cart item no longer exists or is invalid.'=>'Produsul din coș nu mai există sau este invalid.','Unique identifier (key) for the cart item.'=>'Identificator unic (cheie) pentru produsul din coș.','If true, empty terms will not be returned.'=>'Dacă este setat la „true”, termenii goi nu vor fi returnați.','Sort by term property.'=>'Sortează după proprietățile termenilor.','Sort ascending or descending.'=>'Sortează crescător sau descrescător.','Coupon does not exist in the cart.'=>'Cuponul nu există în coș.','Coupon cannot be removed because it is not already applied to the cart.'=>'Cuponul nu poate fi înlăturat, încă nu este aplicat la coș.','Invalid coupon code.'=>'Codul cuponului nu este valid.','Coupons are disabled.'=>'Cupoanele sunt dezactivate.','Unique identifier for the coupon within the cart.'=>'Identificator unic pentru cuponul aplicat la coș.','ISO code for the country of the address being shipped to.'=>'Codul ISO pentru țara unde este adresa la care se face livrarea.','Zip or Postcode of the address being shipped to.'=>'Codul poștal sau ZIP al adresei la care se face livrarea.','ISO code, or name, for the state, province, or district of the address being shipped to.'=>'Cod ISO sau nume pentru județul, provincia, districtul sau statul unde este adresa la care se face livrarea.','City of the address being shipped to.'=>'Localitatea unde este adresa la care se face livrarea.','Second line of the address being shipped to.'=>'A doua linie a adresei la care se face livrarea.','First line of the address being shipped to.'=>'Prima linie a adresei la care se face livrarea.','Limit result set to products based on a maximum price, provided using the smallest unit of the currency.'=>'Limitează setul de rezultate la produse care au un preț maxim, furnizat folosind cea mai mică unitate de monedă.','Limit result set to products based on a minimum price, provided using the smallest unit of the currency.'=>'Limitează setul de rezultate la produse care au un preț minim, furnizat folosind cea mai mică unitate de monedă.