ărul de TVA al unui client din UE, dacă este înregistrat unul.','Get real-time order alerts anywhere'=>'Ai alerte despre comenzi în timp real, oriunde','Get notifications about store activity, including new orders and product reviews directly on your mobile devices with the Woo app.'=>'Cu aplicația Woo, primești notificări direct pe dispozitivele tale mobile despre activitatea magazinului, inclusiv despre comenzi noi și recenzii la produse.','First order received'=>'Ai primit prima comandă','This video tutorial will help you go through the process of adding your first product in WooCommerce.'=>'Acest tutorial video te va ajuta să parcurgi procesul de adăugare a primului tău produs în WooCommerce.','Do you need help with adding your first product?'=>'Ai nevoie de ajutor pentru adăugarea primului produs?','Starting a fashion website is exciting but it may seem overwhelming as well. In this article, we\'ll walk you through the setup process, teach you to create successful product listings, and show you how to market to your ideal audience.'=>'Crearea unui site de modă este o idee interesantă, dar poate fi totodată o acțiune copleșitoare. În acest articol, vom parcurge procesul de inițializare, te învățăm cum să creezi afișări de produse care să aibă succes și îți arătăm cum să lansezi pe piață produsele pentru publicul tău.','Start your online clothing store'=>'Lansează-ți magazinul online de îmbrăcăminte','The admin note layout has a wrong prop value.'=>'Aranjamentul notelor din administrare are o valoare de susținere greșită.','Watch tutorial'=>'Vezi tutorialul','Share feedback'=>'Împărtășește impresiile','Now that you’ve chosen us as a partner, our goal is to make sure we\'re providing the right tools to meet your needs. We\'re looking forward to having your feedback on the store setup experience so we can improve it in the future.'=>'Acum, după ce ne-ai ales ca partener, obiectivul nostru este să ne asigurăm că îți oferim instrumentele potrivite care îți satisfac nevoile. Așteptăm cu nerăbdare impresiile tale despre experiența de inițializare a magazinului, ca s-o putem îmbunătăți în viitor.','Changing eCommerce platforms might seem like a big hurdle to overcome, but it is easier than you might think to move your products, customers, and orders to WooCommerce. This article will help you with going through this process.'=>'Schimbarea unei platforme de comerț electronic poate părea un obstacol mare și greu de depășit, dar este mult mai ușor decât crezi să-ți muți produsele, clienții și comenzile la WooCommerce. Acest articol te va ajuta să parcurgi acest proces.','Do you want to migrate from Shopify to WooCommerce?'=>'Vrei să migrezi de la Shopify la WooCommerce?','WooCommerce Subscriptions allows you to introduce a variety of subscriptions for physical or virtual products and services. Create product-of-the-month clubs, weekly service subscriptions or even yearly software billing packages. Add sign-up fees, offer free trials, or set expiration periods.'=>'Abonamentele WooCommerce îți permit să introduci o varietate de abonamente pentru produse și servicii fizice sau virtuale. Creezi un cerc de persoane pentru produsele lunii, abonamente săptămânale la servicii sau chiar pachete de software cu facturare anuală. Adaugi taxe de înscriere, oferi încercări gratuite și setezi perioadele de expirare.','Do you need more info about WooCommerce Subscriptions?'=>'Ai nevoie de mai multe informații despre abonamentele WooCommerce?','There was a problem activating some of the requested plugins.'=>'A fost o problemă la activarea unora dintre modulele cerute.','Plugins were successfully activated.'=>'Modulele au fost activate cu succes.','The requested plugin `%s`. is not yet installed.'=>'Modulul cerut „%s” nu este încă instalat.','There was a problem installing some of the requested plugins.'=>'A fost o problemă la instalarea unora dintre modulele cerute.','Plugins were successfully installed.'=>'Modulele au fost instalate cu succes.','The 