ord nou de vânzări!','Woohoo, %1$s was your record day for sales! Net sales was %2$s beating the previous record of %3$s set on %4$s.'=>'Ziua %1$s a fost un record în vânzări! Vânzările nete au fost de %2$s depășind recordul anterior de %3$s stabilit pe %4$s.','Review your orders'=>'Examinează-ți comenzile','Browse'=>'Răsfoiește','Another order milestone! Take a look at your Orders Report to review your orders to date.'=>'Ai trecut de un alt prag la comenzi! Vezi raportul Comenzi pentru a examina comenzile făcute până în prezent.','You\'ve hit the 10 orders milestone! Look at you go. Browse some WooCommerce success stories for inspiration.'=>'Ai ajuns la pragul de 10 comenzi! Este o mică realizare. Pentru inspirație, răsfoiește câteva povestiri de succes WooCommerce.','Congratulations on getting your first order! Now is a great time to learn how to manage your orders.'=>'Felicitări pentru primirea primei comenzi! Acum este timpul să înveți cum să-ți administrezi comenzile.','Congratulations on processing %s orders!'=>'Felicitări pentru procesarea a %s comenzi!','Review'=>'Recenzie','Activate usage tracking'=>'Activează urmărirea utilizării','Gathering usage data allows us to improve WooCommerce. Your store will be considered as we evaluate new features, judge the quality of an update, or determine if an improvement makes sense. You can always visit the %1$sSettings%3$s and choose to stop sharing data. %2$sRead more%3$s about what data we collect.'=>'Colectarea datelor de utilizare ne permite să îmbunătățim WooCommerce. Datele de pe magazinul tău vor fi luate în considerare atunci când evaluăm noile funcționalități, ne pronunțăm asupra unei actualizări sau decidem dacă o îmbunătățire are sens. Poți oricând merge la %1$sSetări%3$s și să alegi oprirea partajării datelor. %2$sCitește mai mult%3$s despre ce date colectăm.','The admin note action label prop cannot be empty.'=>'Eticheta acțiunii pentru notă administrator nu poate fi goală.','The admin note action name prop cannot be empty.'=>'Numele acțiunii pentru notă administrator nu poate fi gol.','The admin note date prop cannot be empty.'=>'Data pentru notă administrator nu poate fi goală.','The admin note source prop cannot be empty.'=>'Sursa pentru notă administrator nu poate fi goală.','The admin note status prop (%s) is not one of the supported statuses.'=>'Starea pentru notă administrator (%s) nu este una dintre stările acceptate.','The admin note status prop cannot be empty.'=>'Starea pentru notă administrator nu poate fi goală.','The admin note content_data prop must be an instance of stdClass.'=>'content_data pentru notă administrator trebuie să fie o instanță a stdClass.','The admin note content prop cannot be empty.'=>'Conținutul pentru notă administrator nu poate fi gol.','The admin note title prop cannot be empty.'=>'Titlul pentru notă administrator nu poate fi gol.','The admin note locale prop cannot be empty.'=>'Locala pentru notă administrator nu poate fi goală.','The admin note type prop (%s) is not one of the supported types.'=>'Tipul de notă administrator (%s) nu este unul dintre tipurile acceptate.','The admin note type prop cannot be empty.'=>'Tipul de notă administrator nu poate fi gol.','The admin note name prop cannot be empty.'=>'Numele pentru notă administrator nu poate fi gol.','Add a product'=>'Adaugă un produs','Add your first product'=>'Adaugă primul tău produs','Report table data is being deleted.'=>'Datele din tabelul rapoarte sunt șterse acum.','Report table data is being rebuilt. Please allow some time for data to fully populate.'=>'Datele din tabelul rapoarte sunt reconstruite. Te rog lasă să treacă un timp pentru ca datele să fie complet populate.','An import is already in progress. Please allow the previous import to complete before beginning a new one.'=>'Se desfășoară deja un import. Te rog să permiți finalizarea acestui import înainte de a începe unul nou.','Report sync schedulers should be derived from the Automattic\\WooCommerce\\Internal\\Admin\\Schedulers\\ImportScheduler class.'=>'Programatoarele de sincronizare pentru rapoarte ar trebui să provină din clasa Automattic\\WooCommerce\\Internal\\Admin\\Schedulers\\ImportScheduler.','Default Date Range'=>'Interval de timp implicit','Statuses that require extra action on behalf of the store admin.'=>'Stări care necesită acțiuni suplimentare în numele administratorului magazinului.','Actionable order statuses'=>'Stări comandă asupra cărora poți acționa','Statuses that should not be included when calculating report totals.'=>'Stări care nu ar trebui incluse când se calculează totalul raportului.','Excluded report order statuses'=>'Stări comenzi excluse din raport','Settings for WooCommerce admin reporting.'=>'Setări pentru raportările din administrarea WooCommerce.','%1$s &lsaquo; %2$s'=>'%1$s &lsaquo; %2$s','Stopped the insanity for %d second'=>'A oprit nebunia pentru o secundă' . "\0" . 'A oprit nebunia pentru %d secunde' . "\0" . 'A oprit nebunia pentru %d de secunde','The next queue will begin processing in approximately %d seconds.'=>'Procesarea pentru următoarea coadă de așteptare va începe în aproximativ %d secunde.','A new queue has begun processing. <a href="%s">View actions in-progress &raquo;</a>'=>'A început procesarea pentru o coadă de așteptare nouă. <a href="%s">Vezi acțiunile în curs de desfășurare &raquo;</a>','Unknown status found for action.'=>'Am găsit o stare necunoscută pentru acțiune.','Invalid value for select or count parameter. Cannot query actions.'=>'Valoarea pentru parametrul de selectare sau numărare nu este validă. Nu pot să interoghez acțiunile.','Database error.'=>'Eroare la baza de date.','%s Support for strings longer than this will be removed in a future version.'=>'Suportul %s pentru șiruri mai mari decât aceasta va fi înlăturat într-o versiune viitoare.','ActionScheduler_Action::$args too long. To ensure the args column can be indexed, action args should not be more than %d characters when encoded as JSON.'=>'Actio