ailable (%2$s)'=>'%1$s - Este disponibilă o versiune mai nouă de WordPress (%2$s)','WordPress version'=>'Versiune WordPress','WooCommerce version'=>'Versiune WooCommerce','Settings tab labelPayments'=>'Plăți','Enable coupons'=>'Activează cupoane','Rates will be configurable and taxes will be calculated during checkout.'=>'Tarifele vor fi configurabile și taxele vor fi calculate în timpul finalizării comenzii.','Enable tax rates and calculations'=>'Activează cotele de impozitare și calculele','Manage'=>'Administrează','Account endpoints'=>'Puncte-finale cont','Secure checkout'=>'Finalizare securizată','Legacy API'=>'API moștenit','Retain completed orders for a specified duration before anonymizing the personal data within them.'=>'Păstrează comenzile finalizate pentru o durată de timp specificată înainte de a face anonime datele personale cuprinse în ele.','Retain completed orders'=>'Păstrează comenzile finalizate','Cancelled orders are unpaid and may have been cancelled by the store owner or customer. They will be trashed after the specified duration.'=>'Comenzile anulate sunt cele neachitate și care probabil au fost anulate de proprietarul magazinului sau de clienți. Ele vor fi aruncate la gunoi după o durată de timp specificată.','Retain cancelled orders'=>'Păstrează comenzile anulate','Failed orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Comenzile eșuate sunt cele neachitate și care probabil au fost abandonate de clienți. Ele vor fi aruncate la gunoi după o durată de timp specificată.','Retain failed orders'=>'Păstrează comenzile eșuate','Pending orders are unpaid and may have been abandoned by the customer. They will be trashed after the specified duration.'=>'Comenzile în așteptare sunt cele neachitate și care probabil au fost abandonate de clienți. Ele vor fi aruncate la gunoi după o durată de timp specificată.','Retain pending orders '=>'Păstrează comenzile în așteptare','Inactive accounts are those which have not logged in, or placed an order, for the specified duration. They will be deleted. Any orders will be converted into guest orders.'=>'Conturile inactive sunt cele care nu s-au mai autentificat sau care nu au plasat o comandă pentru o durată de timp specificată. Ele vor fi șterse. Toate comenzile vor fi convertite în comenzi clienți.','Retain inactive accounts '=>'Păstrează conturile inactive','Choose how long to retain personal data when it\'s no longer needed for processing. Leave the following options blank to retain this data indefinitely.'=>'Alege cât timp să păstrezi datele personale când ele nu mai sunt necesare pentru procesare. Lasă următoarele opțiuni necompletate pentru a păstra aceste date pe o perioadă nedeterminată.','Personal data retention'=>'Păstrarea datelor personale','Your personal data will be used to process your order, support your experience throughout this website, and for other purposes described in our %s.'=>'Datele personale vor fi folosite pentru a procesa comanda, pentru a-ți susține experiența pe acest site web și pentru alte scopuri descrise în %s.','Optionally add some text about your store privacy policy to show during checkout.'=>'Opțional, poți adăuga un text despre politica de confidențialitate a magazinului pentru a-l arăta în timpul finalizării.','Checkout privacy policy'=>'Politică de confidențialitate la finalizare','Your personal data will be used to support your experience throughout this website, to manage access to your account, and for other purposes described in our %s.'=>'Datele personale vor fi folosite pentru a-ți susține experiența pe acest site web, pentru a administra accesul la contul tău și pentru alte scopuri descrise în %s.','Optionally add some text about your store privacy policy to show on account registration forms.'=>'Opțional, poți adăuga un text despre politica de confidențialitate a magazinului pentru a-l arăta în formularele de înregistrare a contului.','Registration privacy policy'=>'Politică de confidențialitate la înregistrare','privacy page'=>'pagină de confidențialitate','This section controls the display of your website privacy policy. The privacy notices below will not show up unless a %s is set.'=>'Această secțiune controlează afișarea politicii de confidențialitate a site-ului tău web. Informațiile despre confidențialitate de mai jos nu vor apărea decât dacă este setată mai întâi o %s.','Privacy policy'=>'Politică de confidențialitate','Removed personal data from %s order.'=>'Am înlăturat datele cu caracter personal dintr-o comandă.' . "\0" . 'Am înlăturat datele cu caracter personal din %s comenzi.' . "\0" . 'Am înlăturat datele cu caracter personal din %s de comenzi.','Account erasure requests'=>'Cereri ștergere cont','Accounts &amp; Privacy'=>'Conturi și confidențialitate','List of allowed billing emails to check against when an order is placed. Separate email addresses with commas. You can also use an asterisk (*) to match parts of an email. For example "*@gmail.com" would match all gmail addresses.'=>'Lista emailurilor permise la facturare pentru a verifica când este plasată o comandă. Separă adresele de email cu virgule. Poți folosi și un asterisc (*) pentru a potrivi părți dintr-un email. De exemplu, „*@gmail.com” înseamnă toate adresele Gmail.','Allowed emails'=>'Emailuri permise','Filter by registered customer'=>'Filtrează după clienți înregistrați','Remove personal data'=>'Înlătură datele personale','Use previous column mapping preferences?'=>'Folosești preferințele anterioare de mapare a coloanelor?','View &amp; Customize'=>'Vizualizează și personalizează','Review Settings'=>'Setări recenzii','Visit Dashboard'=>'Mergi la Panou control','You can also:'=>'De asemenea, poți:','You\'re ready to add products to your store.'=>'Poți să adaugi produse în magazinul tău.','Create some products'=>'Creează câteva produse','Continue with WooCommerce Services'=>'Continuă cu Servicii WooCommerce','Connect your store to activate WooCo