d. Products that do not exist will be skipped.'=>'Produsele existente care se potrivesc după ID sau SKU vor fi actualizate. Produsele care nu există vor fi sărite.','To receive updates and support for this extension, you need to <strong>purchase</strong> a new subscription or consolidate your extensions to one connected account by <strong><a href="%1$s" title="Sharing Docs">sharing</a> or <a href="%2$s" title="Transferring Docs">transferring</a></strong> this extension to this connected account.'=>'Pentru a primi actualizări și suport pentru această extensie, trebuie să <strong>cumperi</strong> un abonament nou sau să-ți consolidezi extensiile într-un singur cont conectat prin <strong><a href="%1$s" title="Partajarea de documente">partajarea</a> sau <a href="%2$s" title="Transferarea de documente">transferarea</a></strong> acestei extensii în acest cont conectat.','The WooCommerce Helper plugin is no longer needed. <a href="%s">Manage subscriptions</a> from the extensions tab instead.'=>'Modulul WooCommerce Helper nu mai este necesar. În schimb, <a href="%s">administrează abonamentele</a> din fila extensii.','Webhook topic unknown. Please select a valid topic.'=>'Subiect cârlig web necunoscut. Te rog selectează un subiect valid.','Delete "%s" permanently'=>'Șterge „%s” definitiv','Reasons you\'ll love Jetpack'=>'Motive pentru care vei îndrăgi Jetpack','Continue with Jetpack'=>'Continuă cu Jetpack','payment setup'=>'inițializare plată','payment setup and automated taxes'=>'inițializare plată și taxe automate','Square'=>'Pătrat','Klarna Payments'=>'Plăți Klarna','Klarna Checkout'=>'Finalizare Klarna','Email address to receive payments'=>'Adresă de email pentru a primi plăți','Direct payments to email address:'=>'Plăți directe la adresa de email:','Securely accept credit and debit cards with one low rate, no surprise fees (custom rates available). Sell online and in store and track sales and inventory in one place. <a href="%s" target="_blank">Learn more about Square</a>.'=>'Accepți în siguranță carduri de credit și debit cu o cotă scăzută, fără taxe surpriză (sunt disponibile cote personalizate). Vinzi online și din magazin și urmărești vânzările și inventarul dintr-un singur loc. <a href="%s" target="_blank">Află mai multe despre Square</a>.','Choose the payment that you want, pay now, pay later or slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'Alegi plata pe care o vrei, plătești acum, plătești mai târziu sau o eșalonezi. Fără numere de card de credit, fără parole, fără nicio grijă. <a href="%s" target="_blank">Află mai multe despre Klarna</a>.','Full checkout experience with pay now, pay later and slice it. No credit card numbers, no passwords, no worries. <a href="%s" target="_blank">Learn more about Klarna</a>.'=>'O experiență completă de finalizare cu plătești acum, plătești mai târziu sau în rate. Fără numere de card de credit, fără parole, fără nicio grijă. <a href="%s" target="_blank">Află mai multe despre Klarna</a>.','Accept debit and credit cards in 135+ currencies, methods such as Alipay, and one-touch checkout with Apple Pay. <a href="%s" target="_blank">Learn more</a>.'=>'Accepți carduri de debit și credit în peste 135 de monede, metode precum Alipay și finalizare printr-o singură atingere cu Apple Pay. <a href="%s" target="_blank">Află mai mult</a>.','I will also be selling products or services in person.'=>'Voi vinde, de asemenea, produse sau servicii în nume propriu.','Customer downloads'=>'Descărcări clienți','Revision restored.'=>'Am restaurat revizia.','If you like, you may enter custom structures for your product URLs here. For example, using <code>shop</code> would make your product links like <code>%sshop/sample-product/</code>. This setting affects product URLs only, not things such as product categories.'=>'Dacă vrei, poți introduce aici structuri personalizate pentru URL-urile produselor tale. De exemplu, folosind <code>shop</cod