ch'=>'Căutare produse','A search form for your store.'=>'Un formular de căutare pentru magazinul tău.','Maximum depth'=>'Adâncime maximă','Filter Products by Price'=>'Filtrează produsele după preț','Display a slider to filter products in your store by price.'=>'Afișează un carusel pentru a filtra produsele din magazinul tău după preț.','Filter Products by Attribute'=>'Filtrează produsele după atribute','Display a list of attributes to filter products in your store.'=>'Afișează o listă de atribute pentru a filtra produsele din magazinul tău.','Active Product Filters'=>'Filtre active pentru produse','Display a list of active product filters.'=>'Afișează o listă cu filtrele active pentru produse.','Display the customer shopping cart.'=>'Afișează coșul de cumpărături al clientului.','Relevance'=>'Relevanță','%1$s should not be called before the %2$s action.'=>'%1$s nu trebuie să fie apelată înainte de acțiunea %2$s.','The class %1$s provided by %2$s filter must implement %3$s.'=>'Clasa %1$s furnizată de filtrul %2$s trebuie să implementeze %3$s.','Please, provide an attribute name.'=>'Te rog furnizează un nume de atribut.','Sorry, the order could not be found. Please contact us if you are having difficulty finding your order details.'=>'Regret, comanda nu a putut fi găsită. Te rog contactează-ne dacă ai dificultăți în găsirea detaliilor comenzii.','Please enter a valid email address'=>'Te rog să introduci o adresă de email validă','Sorry, "%s" is no longer in stock so this order cannot be paid for. We apologize for any inconvenience caused.'=>'Regret, „%s” nu mai este în stoc, deci această comandă nu poate fi plătită. Ne cerem scuze pentru eventualele neplăceri cauzate.','%1$s was called with an invalid level "%2$s".'=>'%1$s a fost apelată cu un nivel „%2$s” invalid.','The provided handler %1$s does not implement %2$s.'=>'Manipulantul furnizat %1$s nu implementează %2$s.','Unable to add payment method to your account.'=>'Nu pot adăuga metoda de plată la contul tău.','Payment method successfully added.'=>'Am adăugat cu succes metoda de plată.','Invalid payment gateway.'=>'Gateway-ul de plată nu este valid.','Sorry, this coupon is not applicable to selected products.'=>'Regret, acest cupon nu poate fi aplicat pentru produsele selectate.','Invalid discount amount'=>'Valoarea reducerii nu este validă','Create account password'=>'Creează parolă cont','Fee has already been added.'=>'Taxa a fost deja adăugată.','%s fee'=>'Taxă %s','This option will delete ALL of your tax rates, use with caution. This action cannot be reversed.'=>'Această opțiune va șterge TOATE cotele de impozitare, folosește-o cu prudență. Această acțiune nu poate fi anulată.','Delete tax rates'=>'Șterge cotele de impozitare','Create pages'=>'Creează pagini','Create default WooCommerce pages'=>'Creează pagini WooCommerce implicite','Clear customer sessions'=>'Șterge sesiunile clienților','WooCommerce transients'=>'Tranzienți WooCommerce','Page settingTerms and conditions'=>'Termeni și condiții','Post Type Counts'=>'Număr tip de articol','Database Index Size'=>'Dimensiune index bază de date','Database Data Size'=>'Dimensiune date bază de date','Total Database Size'=>'Dimensiune totală bază de date','%s failed. Contact your hosting provider.'=>'%s a eșuat. Contactează-ți furnizorul de găzduire.','Forcing downloads will keep URLs hidden, but some servers may serve large files unreliably. If supported, %1$s / %2$s can be used to serve downloads instead (server requires %3$s).'=>'Forțarea descărcărilor va ține URL-urile ascunse, dar unele servere pot servi fișiere mari nesigure. Dacă este suportat, %1$s / %2$s poate fi folosit pentru a servi descărcări în schimb (serverul necesită %3$s).','The postal code, if any, in which your business is located.'=>'Codul poștal, dacă există, pentru locul unde este afacerea ta.','The country and state or province, if any, in which your business is located.'=>'Țara și statul sau provincia, dacă există, în care este localizată afacerea ta.'