 order details to customer'=>'Trimite detaliile pentru comenzi clienților','Position'=>'Poziție','Upload a new file'=>'Încarcă un fișier nou','The file is empty or using a different encoding than UTF-8, please try again with a new file.'=>'Fișierul este gol sau se utilizează o altă codificare decât UTF-8, te rog încearcă din nou cu un fișier nou.','Lifetime Subscription'=>'Abonament pe viață','Sort by:'=>'Sortează după:','Below is a list of extensions available on your WooCommerce.com account. To receive extension updates please make sure the extension is installed, and its subscription activated and connected to your WooCommerce.com account. Extensions can be activated from the <a href="%s">Plugins</a> screen.'=>'Mai jos este o listă cu extensiile disponibile pentru contul tău WooCommerce.com. Pentru a primi actualizări pentru o extensie, te rog asigură-te că extensia este instalată și că abonamentul este activat și conectat la contul tău WooCommerce.com. Extensiile pot fi activate din ecranul <a href="%s">Module</a>.','Expired'=>'Expirat','Expiring Soon'=>'Expiră în curând','Update Available'=>'Este disponibilă o actualizare','If you like %1$s please leave us a %2$s rating. A huge thanks in advance!'=>'Dacă îți place %1$s, te rog acordă-ne o evaluare de %2$s. Multe mulțumiri în avans!','Transfer existing products to your new store — just import a CSV file.'=>'Transferă produsele existente în noul tău magazin — doar imporți un fișier CSV.','Import products'=>'Importă produsele','Have an existing store?'=>'Ai deja un magazin?','Create a product'=>'Creează un produs','Yes please!'=>'Da, te rog!','We\'re here for you — get tips, product updates, and inspiration straight to your mailbox.'=>'Suntem aici pentru tine — primești sfaturi, actualizări produs și surse de inspirație direct prin email.','You\'re ready to start selling!'=>'Ești gata să începi vânzarea!','Your site might be on a private network. Jetpack can only connect to public sites. Please make sure your site is visible over the internet, and then try connecting again 🙏.'=>'Site-ul poate fi într-o rețea privată. Jetpack se poate conecta numai la site-uri publice. Te rog asigură-te că site-ul tău este vizibil pe internet și apoi încearcă din nou conectarea 🙏.','Sorry! We couldn\'t contact Jetpack just now 😭. Please make sure that your site is visible over the internet, and that it accepts incoming and outgoing requests via curl. You can also try to connect to Jetpack again, and if you run into any more issues, please contact support.'=>'Regretăm! Nu am putut conecta Jetpack acum 😭. Te rog asigură-te că site-ul tău este vizibil pe internet și că acceptă cereri de intrare și ieșire prin curl. De asemenea, poți încerca să te conectezi din nou la Jetpack și dacă întâmpini alte probleme, te rog contactează suportul.','Sorry! We tried, but we couldn\'t install Jetpack for you 😭. Please go to the Plugins tab to install it, and finish setting up your store.'=>'Regretăm! Am încercat, dar n-am putut instala Jetpack pentru tine 😭. Te rog du-te la fila Module pentru a-l instala și finalizează-ți inițializarea magazinului.','Sorry! We tried, but we couldn\'t connect Jetpack just now 😭. Please go to the Plugins tab to connect Jetpack, so that you can finish setting up your store.'=>'Regretăm! Am încercat, dar n-am putut conecta Jetpack acum 😭. Te rog du-te la fila Module pentru a conecta Jetpack, ca să poți să-ți finalizezi inițializarea magazinului.','Share new items on social media the moment they\'re live in your store.'=>'Partajezi produse noi pe media socială în momentul în care sunt live în magazinul tău.','Product promotion'=>'Promovare produse','Get an alert if your store is down for even a few minutes.'=>'Primești o alertă în numai câteva minute dacă magazinul tău cade.','Store monitoring'=>'Monitorizare magazin','Get insights on how your store is doing, including total sales, top products, and more.'=>'Obții informații despre ce se întâmplă în magazinul tău, inclusiv vânzări