ail.'=>'Numele de utilizator sau emailul nu este valid.','Enter a username or email address.'=>'Introdu un nume de utilizator sau o adresă de email.','Log in'=>'Autentificare','The order totals have been updated. Please confirm your order by pressing the "Place order" button at the bottom of the page.'=>'Totalul comenzii a fost actualizat. Te rog confirmă-ți comanda prin apăsarea butonului „Plasează comanda” de la sfârșitul paginii.','Date:'=>'Dată:','Order number:'=>'Număr comandă:','Sorry, this order is invalid and cannot be paid for.'=>'Regret, această comandă nu este validă și nu poate fi plătită.','This order&rsquo;s status is &ldquo;%s&rdquo;&mdash;it cannot be paid for. Please contact us if you need assistance.'=>'Starea acestei comenzi este &bdquo;%s&rdquo; - nu poate fi plătită. Te rog contactează-ne dacă ai nevoie de asistență.','My account'=>'Contul meu','Shipping costs updated.'=>'Am actualizat costurile de livrare.','What ZIP/post codes are available for local pickup?'=>'Ce coduri poștale/ZIP sunt disponibile pentru preluare locală?','Separate codes with a comma. Accepts wildcards, e.g. <code>P*</code> will match a postcode of PE30. Also accepts a pattern, e.g. <code>NG1___</code> would match NG1 1AA but not NG10 1AA'=>'Separă codurile cu o virgulă. Sunt acceptare metacaractere, de exemplu, <code>P*</code> se va potrivi cu un cod poștal precum PE30. De asemenea, este acceptat un model, de exemplu, <code>NG1 ___</code> se potrivește cu NG1 1AA, dar nu NG10 1AA','What ZIP/post codes are available for local delivery?'=>'Ce coduri poștale/ZIP sunt disponibile pentru livrare locală?','Allowed ZIP/post codes'=>'Coduri poștale/ZIP acceptate','What fee do you want to charge for local delivery, disregarded if you choose free. Leave blank to disable.'=>'Ce taxă vrei să percepi pentru o livrare locală, va fi ignorată dacă alegi livrare gratuită. Lasă gol pentru a dezactiva.','Delivery fee'=>'Taxă de livrare','Fixed amount per product'=>'Sumă fixă per produs','Perc