are','"%s" shipping class cost'=>'Cost pentru clasa de livrare „%s”','These costs can optionally be added based on the <a href="%s">product shipping class</a>.'=>'Aceste costuri pot fi adăugate opțional în funcție de <a href="%s">clasa de livrare a produsului</a>.','Shipping class costs'=>'Costuri pentru clasa de livrare','Select some countries'=>'Selectează câteva țări','All allowed countries'=>'Toate țările permise','Availability'=>'Disponibilitate','Method title'=>'Titlu metodă','Supports the following placeholders: <code>[qty]</code> = number of items, <code>[cost]</code> = cost of items, <code>[fee percent="10" min_fee="20"]</code> = Percentage based fee.'=>'Suportă următorii substituenți: <code>[qty]</code> = număr de elemente, <code>[cost]</code> = costul elementelor, <code>[fee percent="10" min_fee="20"]</code> = taxă bazată pe procente.','Enter a cost (excl. tax) or sum, e.g. <code>10.00 * [qty]</code>.'=>'Introdu un cost (exclusiv taxă) sau o sumă, de exemplu <code>10.00 * [qty]</code>.','Flat rate'=>'Forfetar','Credit card'=>'Card de credit','[Order #%s]'=>'[Comanda nr. %s]','Get your API credentials from PayPal.'=>'Ia-ți datele de conectare la API de la PayPal.','Enter your PayPal API credentials to process refunds via PayPal. Learn how to access your <a href="%s">PayPal API Credentials</a>.'=>'Introdu datele tale de conectare la PayPal API pentru a procesa rambursările via PayPal. Află cum poți accesa <a href="%s">datele de conectare PayPal API</a>.','API credentials'=>'Date de conectare la API','Authorize'=>'Autorizează','Capture'=>'Captează','Choose whether you wish to capture funds immediately or authorize payment only.'=>'Alege dacă vrei să captezi fonduri imediat sau doar să autorizezi plata.','Payment action'=>'Acțiune de plată','PayPal verifies addresses therefore this setting can cause errors (we recommend keeping it disabled).'=>'PayPal verifică adresele, de aceea această setare poate cauza erori (recomandăm să fie dezactivată).','Enable "addre